(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d0bd5b9"],{"2c3e":function(n,e){n.exports='# Trend 趋势标记\n\n趋势符号，标记上升和下降趋势。通常用绿色代表“好”，红色代表“不好”，股票涨跌场景除外。\n\n引用方式：\n\n```javascript\nimport { Trend } from \'@/components\'\n\nexport default {\n    components: {\n        Trend\n    }\n}\n```\n\n## 代码演示  [demo](https://preview.pro.loacg.com/test/home)\n\n```html\n<trend flag="up">5%</trend>\n```\n或\n```html\n<trend flag="up">\n    <span slot="term">工资</span>\n    5%\n</trend>\n```\n或\n```html\n<trend flag="up" term="工资">5%</trend>\n```\n\n## API\n\n| 参数      | 说明                                      | 类型         | 默认值 |\n|----------|------------------------------------------|-------------|-------|\n| flag | 上升下降标识：`up|down` | string | - |\n| reverseColor | 颜色反转 | Boolean | false |\n'}}]);